class Team {
    /**
     *
     * @param home
     */
    setHome(home){
        this.home=home;
    }
    getHome(){
        return this.home;
    }

    /**
     *
     * @param home
     */
    setAway(away){
        this.away=away;
    }
    getAway(){
        return this.away;
    }
}

export default Team;
